// SPDX-License-Identifier: MIT
pragma solidity ^0.8.28;

contract RentalAgreement {
    address public landlord;
    address public tenant;
    uint public rentAmount; // in wei
    uint public depositAmount; // in wei
    uint public leaseStart;
    uint public leaseEnd;
    bool public isSigned;
    bool public isDepositPaid;
    bool public isTerminated;

    event AgreementSigned(address tenant);
    event DepositPaid(address tenant, uint amount);
    event RentPaid(address tenant, uint amount);
    event AgreementTerminated(address landlord);

    modifier onlyTenant() {
        require(msg.sender == tenant, "Only tenant can call this");
        _;
    }

    modifier onlyLandlord() {
        require(msg.sender == landlord, "Only landlord can call this");
        _;
    }

    modifier agreementActive() {
        require(!isTerminated, "Agreement terminated");
        _;
    }

    constructor(
        address _tenant,
        uint _rentAmount,
        uint _depositAmount,
        uint _leaseStart,
        uint _leaseEnd
    ) {
        require(_leaseEnd > _leaseStart, "Lease end must be after start");
        landlord = msg.sender;
        tenant = _tenant;
        rentAmount = _rentAmount;
        depositAmount = _depositAmount;
        leaseStart = _leaseStart;
        leaseEnd = _leaseEnd;
        isSigned = false;
        isDepositPaid = false;
        isTerminated = false;
    }

    function signAgreement() public onlyTenant agreementActive {
        require(!isSigned, "Agreement already signed");
        isSigned = true;
        emit AgreementSigned(msg.sender);
    }

    function payDeposit() public payable onlyTenant agreementActive {
        require(isSigned, "Agreement not signed yet");
        require(!isDepositPaid, "Deposit already paid");
        require(msg.value == depositAmount, "Incorrect deposit amount");
        isDepositPaid = true;
        payable(landlord).transfer(msg.value);
        emit DepositPaid(msg.sender, msg.value);
    }

    function payRent() public payable onlyTenant agreementActive {
        require(isSigned, "Agreement not signed yet");
        require(isDepositPaid, "Deposit not paid");
        require(block.timestamp >= leaseStart && block.timestamp <= leaseEnd, "Rent payment outside lease period");
        require(msg.value == rentAmount, "Incorrect rent amount");
        payable(landlord).transfer(msg.value);
        emit RentPaid(msg.sender, msg.value);
    }

    // Allow landlord to terminate agreement (e.g. at lease end)
    function terminateAgreement() public onlyLandlord agreementActive {
        require(block.timestamp >= leaseEnd, "Lease period not ended");
        isTerminated = true;
        emit AgreementTerminated(msg.sender);
    }

    // Landlord can refund deposit after termination
    function refundDeposit() public onlyLandlord {
        require(isTerminated, "Agreement not terminated");
        require(isDepositPaid, "Deposit not paid");
        isDepositPaid = false; // prevent double refund
        payable(tenant).transfer(depositAmount);
    }
}

